import { RouterProvider, createBrowserRouter } from "react-router-dom";
import HomePage from "./components/Pages/Home";
import EventsPage, { loader } from "./components/Pages/Events";
import EventDetailPage from "./components/Pages/EventDetails";
import NewEventPage from "./components/Pages/NewEvent";
import EditEventPage from "./components/Pages/EditEvent";
import Layout from "./components/Pages/Root";
import EventsRootLayout from "./components/Pages/EventsRoot";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Layout />,
    children: [
      { index: true, element: <HomePage /> },
      {
        path: "events",
        element: <EventsRootLayout />,
        children: [
          {
            index: true,
            element: <EventsPage />,
            loader: loader,
          },
          { path: ":eventId", element: <EventDetailPage /> },
          { path: "new", element: <NewEventPage /> },
          { path: ":eventId/edit", element: <EditEventPage /> },
        ],
      },
    ],
  },
]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
